import React from 'react';
import Footer from '../Footer/Footer';
import NavBar from '../NavBar/NavBar';

const CheckOut: React.FC = () => {
	return (
		<div>
			<NavBar />
			<Footer />
		</div>
	);
};

export default CheckOut;
